webpackJsonp([0xa442df4ebea2],{499:function(e,n){e.exports={data:{markdownRemark:{html:'<p>Sue Dann BA (Hons.) Cert. KLC, Member BIID</p>\n<p>After obtaining a First Class Honours Degree in Fashion and Textiles Sue worked in the fashion industry for 20 years; in London, Paris and Italy as well as undertaking various projects in the Far East.</p>\n<p>The work included designing textiles and colour forecasting as well as designing and running fashion shows and exhibitions.</p>\n<p>Her wide spectrum of abilities within the design field were easily transposed into the Interior Design Industry when she set up Sue Dann Interiors in 1998 after completing an Interior Design course at the KLC School of Interior Design in London.</p>\n<p>Since setting up Sue Dann Interiors, Sue has undertaken many projects including complete renovations and redecoration of listed properties in Bucks. Surrey and Somerset as well as many Hotel projects around the country.</p>\n<p>Sue Dann is a Member of <a href="https://biid.org.uk/users/sue-dann">The British Institute of Interior Design</a>.</p>',frontmatter:{date:null,slug:"sue-dann-profile",title:"Sue Dann Profile",cover:null,sidebar:"profile.jpg"}}},pathContext:{slug:"sue-dann-profile"}}}});
